import React from "react";
import Item from "./Item";

const ListItem = (props) => {
  return (
    <div>
      <li>
        {props.items.map((item) => (
          <Item
            key={item.id}
            title={item.title}
          />
          ))}
      </li>
   
    </div>
  );
};

export default ListItem;
